import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import ShoppingList from './ShoppingList'
import AllShoppingLists from './AllShoppingLists';

export class ShoppingListViewer extends React.Component {
    render() {
        return(
            <section className='wrapper'>
       
                    <h1>Shopping Lists</h1>
                    <ListOfLists />
                    <ListOfProducts />


                
            </section>
        );
    }

}


class ListOfLists extends React.Component {
    render() {
        return <h2>All Shopping Lists</h2>
    }
}

class ListOfProducts extends React.Component {
    render() {
        return <div className="listofproducts">

      </div>
    }
}



export default ShoppingListViewer;
